import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: 'home.page.html',
  styleUrls: ['home.page.scss'],
})
export class HomePage {
  slideOpts = {
    initialSlide: 1,
    speed: 100,
    pagination: false,
    autoHeight: true,
    // longSwipes: false
  };

  constructor() { }

}
